// SPDX-License-Identifier: GPL-3.0
pragma solidity 0.6.12;
pragma experimental ABIEncoderV2;

import "@openzeppelin/contracts/access/Ownable.sol";

contract Main is Ownable {

	struct Skill {
		string name;
		string effect;
	}

	struct Card {
		uint8 id;
		uint8 saint;

		string name;
		string class;
		uint8 level;
		uint8 rank;
		uint8 npLv;

		uint8 levelCap;

		Skill active;
		Skill passive;

		uint16 atk;
		uint16 def;
		uint16 hp;
		uint16 critRate;
		uint16 critMultiplier;

		uint8 atkPerLevel;
		uint8 defPerLevel;
		uint8 hpPerLevel;
	}

	struct Master {
		string name;
	}

	struct Pool {
		mapping(uint8 => Card) cards;
		mapping(uint8 => uint8) rates;
	}

	event NewMaster(address masterAddress, string name);
	event Overflow(address masterAddress);

	mapping (address => Master) masters;
	mapping (address => uint) created;
	mapping (address => Card[]) drawed;
	Pool total;

  	function createMaster(string memory name) public {
  		require(created[msg.sender] == 0);
  		created[msg.sender] = 1;
  		masters[msg.sender] = Master(name);
  		Card memory card = Card(1, 1, "Mashu Kyrielight", "Shielder", 1, 3, 1, 60, Skill("Undefined", "Undefined"), Skill("Undefined", "Undefined"), 10, 10, 1000, 25, 200, 100, 100, 100);
  		drawed[msg.sender].push(card);
  	}

  	function getMaster() public view returns(string memory, Card[] memory) {
  		require(created[msg.sender] == 1);
  		return (masters[msg.sender].name, drawed[msg.sender]);
  	}

  	function getCards() public view returns(Card[] memory) {
  		require(created[msg.sender] == 1);
  		return drawed[msg.sender];
  	}

  	function rollOne() public payable returns(Card memory) {
  		return total.cards[0];
  	}

  	function addCardToPool(uint8 id, string memory name, string memory class, uint8 rank, 
  						   uint16 atk, uint16 def, uint16 hp,
  						   uint8 atkPerLevel, uint8 defPerLevel, uint8 hpPerLevel, uint8 rate) public onlyOwner  {
  		require(total.rates[id] == 0);
  		uint8 levelCap = 0;
  		if(rank == 1) levelCap = 55;
  		if(rank == 2) levelCap = 60;
  		if(rank == 3) levelCap = 70;
  		if(rank == 4) levelCap = 80;
  		if(rank == 5) levelCap = 90;
  		Card memory newCard = Card(id, 1, name, class, 1, rank, 1, levelCap, Skill("Undefined", "Undefined"), Skill("Undefined", "Undefined"), atk, def, hp, 25, 200, atkPerLevel, defPerLevel, hpPerLevel);
  		total.cards[id] = newCard;
  		total.rates[id] = rate;
  	}

  	function setRates(uint8 id, uint8 newRate) public onlyOwner {
  		require(total.rates[id] != 0);
  		total.rates[id] = newRate;
  	}

}
